import React from "react";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      counter: 0,
    };
  }
  setCounter() {
    this.counter++;
    console.log(this.counter);
  }
  render() {
    return (
      <>
        <h1>counter is : {this.state.counter} </h1>
        <button onClick={() => this.setCounter}>click</button>
      </>
    );
  }
}
export default App;
